import React from 'react';
import { Container, Button, Text} from './styles/accordsignin';

export default function accordsignin({ children, ...restProps }) {
    return (
        <Container {...restProps} >{children}</Container>
    );
};

accordsignin.Button = function accordsigninButton({ children, ...restProps}) {
    return(
        <Button {...restProps}>
            {children} <img src="/images/icons/chevron-right.png" alt="Try Now" />
        </Button>
    );
};


accordsignin.Text = function accordsigninText({ children, ...restProps}) {
    return (
        <Text {...restProps}>
         {children}
 
        </Text>

    );     
};
